import React from 'react';

const FormRenderer = ({ questions }) => {
  return (
    <div className="p-4 bg-gray-50">
      <h2 className="text-xl font-bold mb-4">Rendered Form</h2>
      {questions.map((question, index) => (
        <div key={index} className="border p-4 rounded-md shadow-md mb-4 bg-white">
          {question.type === 'categorized' && (
            <div>
              <h3 className="font-bold">Categorized Question</h3>
              <p>Categories: {question.data.categories.join(', ')}</p>
              <p>Options: {question.data.options.join(', ')}</p>
            </div>
          )}
          {question.type === 'cloze' && (
            <div>
              <h3 className="font-bold">Cloze Question</h3>
              <p>{question.data.text}</p>
              <p>Blanks: {question.data.blanks.join(', ')}</p>
            </div>
          )}
          {question.type === 'comprehension' && (
            <div>
              <h3 className="font-bold">Comprehension Question</h3>
              <p>{question.data.text}</p>
              {question.data.mcqs.map((mcq, idx) => (
                <div key={idx} className="mt-2">
                  <p className="font-semibold">{mcq.question}</p>
                  <p>Options: {mcq.options.join(', ')}</p>
                </div>
              ))}
            </div>
          )}
        </div>
      ))}
    </div>
  );
};

export default FormRenderer;
